import React from 'react';
import { Routes, Route } from 'react-router-dom';
import Navbar from '../components/Navbar';
import Footer from '../components/Footer';
import ProtectedRoute from '../components/ProtectedRoute';

import Home from '../pages/Home';
import About from '../pages/About';
import Contact from '../pages/Contact';
import Login from '../pages/auth/Login';
import Register from '../pages/auth/Register';

import CitizenDashboard from '../pages/citizen/Dashboard';
import ReportIssue from '../pages/citizen/ReportIssue';
import MyIssues from '../pages/citizen/MyIssues';

import AdminDashboard from '../pages/admin/Dashboard';
import ManageIssues from '../pages/admin/ManageIssues';

import DepartmentDashboard from '../pages/department/Dashboard';
import UpdateStatus from '../pages/department/UpdateStatus';

const AppRoutes = () => {
  return (
    <>
      <Navbar />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/about" element={<About />} />
        <Route path="/contact" element={<Contact />} />
        <Route path="/login" element={<Login />} />
        <Route path="/register" element={<Register />} />

        <Route path="/citizen/dashboard" element={
          <ProtectedRoute allowedRoles={['citizen']}>
            <CitizenDashboard />
          </ProtectedRoute>
        } />
        <Route path="/citizen/report" element={
          <ProtectedRoute allowedRoles={['citizen']}>
            <ReportIssue />
          </ProtectedRoute>
        } />
        <Route path="/citizen/my-issues" element={
          <ProtectedRoute allowedRoles={['citizen']}>
            <MyIssues />
          </ProtectedRoute>
        } />

        <Route path="/admin/dashboard" element={
          <ProtectedRoute allowedRoles={['admin']}>
            <AdminDashboard />
          </ProtectedRoute>
        } />
        <Route path="/admin/manage" element={
          <ProtectedRoute allowedRoles={['admin']}>
            <ManageIssues />
          </ProtectedRoute>
        } />

        <Route path="/department/dashboard" element={
          <ProtectedRoute allowedRoles={['department']}>
            <DepartmentDashboard />
          </ProtectedRoute>
        } />
        <Route path="/department/update" element={
          <ProtectedRoute allowedRoles={['department']}>
            <UpdateStatus />
          </ProtectedRoute>
        } />
      </Routes>
      <Footer />
    </>
  );
};

export default AppRoutes;
